import base64
from Crypto.Cipher import DES
from Crypto.Util.Padding import unpad,pad

#important:注意要的是八个字节
key = '1qaz@wsx'.encode('utf-8')
des = DES.new(key=key,mode=DES.MODE_ECB)


b64str = input('输入b64字符串>>>>>')

#先将b64字符串还原成字节然后解密
b64by = base64.b64decode(b64str)
s = des.decrypt(b64by)
s = unpad(s,8)
print(len(s))
s = s.decode('utf-8')
print(s)
print(type(s))
